import Nav from 'react-bootstrap/Nav';
import React from 'react';

export default function Navbar(){
    
    return(
        <Nav className="navbar navbar-light bg-light">
            <div className='bg-info text-white p-1 justify-content'>
                Esteban Garces
            </div>
            <Nav className='justify-content-end'>
                <Nav.Item>
                    <Nav.Link eventKey={1} href='/' className='nav-link list-group-item px-2' onClick={this.handleSelect}>About Me</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey={2} href='/portfolio' className='nav-link list-group-item px-2' onClick={this.handleSelect}>Portfolio</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey={3} href='/contact' className='nav-link list-group-item px-2' onClick={this.handleSelect}>Contact</Nav.Link>
                </Nav.Item>
            </Nav>
        
            <style jsx>{`
            div {
                font-size: 34px
                }
            `}</style>
        </Nav>
        )}
;
